                        </Col>
                        <Col xs="auto">
                            <Button variant="contained" color="primary" className="textst"
                                onClick={() => {
                                    navigate('/add')
                                }}>
                                Add
                            </Button>
                        </Col>
                    </Row>
                </Container>
            </Navbar>

            <Container>
                Title
                <input onChange={(e) => {
              props.setId(e.target.value);
                }}
            
                placeholder="아이디"
                type="text"
          />

            </Container>



           
        </div>
    )
}

export default Add;
